  false,\n\t\"url\": null,\n\t\"notes\": \"Lake morphometry metrics are known to influence
  productivity in lakes and are important for building various types of ecological
  and environmental models of lentic systems. The lake morphometry dataset included
  here contains estimates of Surface Area, Shoreline Length, Shoreline Development,
  Maximum Depth, Mean Depth, Lake Volume, Maximum Lake Length, Mean Lake Width, Maximum
  Lake Width, and Fetch for each of the u201clakepondu201d waterbodies in the NHDPlus
  V2. The current release of the datasets is version 0.1 and future refinements to
  the data are expected.\",\n\t\"owner_org\": \"6d90e48d-3076-4327-b2f4-c33919f374d5\",\n\t\"extras\":
